import { useState, useEffect } from 'react'
import countryServices from './services/countries'
import Display from './components/Display'
import axios from 'axios'

const App = () => {
  const [country, setCountry] = useState('')
  const [value, setValue] = useState('')
  const [allCountries, setAllCountries] = useState([])
  const handleChange = (event) => {
    const val = event.content.value
    setValue(val)
    setAllCountries(countryServices.getAll().filter(countryObject => countryObject.name.toLowerCase().includes(val.toLowerCase())))
  }

  return (
    <div>
      <form>
        find countries <input value={value} onChange={handleChange} />
        <Display countryName={country.name.common} capital={country.capital} area={country.area} languages={country.languages} />
      </form>

    </div>
  )
}


export default App
